const add = function (nbr1, nbr2) {
  return nbr1 + nbr2;
};

const subtract = function (nbr1, nbr2) {
  return nbr1 - nbr2;
};

const sum = function (nbr1, nbr2) {
  let sum = +nbr1 + nbr2;
  return sum;
};

const multiply = function (nbr1, nbr2) {
  return nbr1 * nbr2;
};

const power = function (base, exponent) {
  return base ** exponent;
};

const factorial = function (nbr1, nbr2) {};

